“The Beauty in the Struggle” I designed this piece after a long consult with my client not knowing exactly what she wanted but having a life story she wanted to illustrate and said she “just wanted a Parry tattoo”. During our a long talk/consult and getting to know her details I realized this story was more about all of the crazy challenges she had in life and that without that she wouldn’t be who she is today, which is one of the most amazing people I know! So I wanted to illustrate that and give her a design to wear that reminded her of that while still having some creepy fun characters!  Thank you Jodie, this was such an honor to do for you and becoming a best friend in the process has been even better, love you! 
Also, this is fully healed for 2 years at the time of the picture. Swipe to see some close up and my sketch as well! Thanks for looking! 

